            "title": "A Greve geral de 1917: Perspectivas Anarquistas",
            "author": "Vários Autores",
            "price": 3500,
            "unities": 100,
            "year": 2017,
            "publisher": "Biblioteca Terra Livre",
            "description": "O movimento operário de São Paulo, em 1917, já estava imbuído de anarquismo. Não apenas do ideário, mas da estratégia política de ação libertária, fruto de quase duas décadas de experiências de ação direta. A estratégia de ação direta como orientação da luta operária no Brasil foi definida no 1º Congresso Operário Brasileiro, realizado no Rio de Janeiro, em abril de 1906. Desde então, as diversas agitações operárias, manifestações públicas, mobilizações e movimentos grevistas, durante as duas primeiras décadas do século XX, em São Paulo, sob orientação anarquista fizeram da ação direta, alicerçada na autonomia, na autodeterminação dos indivíduos, a sua estratégia de luta política.\n(Christina da Silva Roquette Lopreato)",
